export default function App() {
  return (
    <div className="app">
      <Logo />
      <Form />
      <PackingList />
      <Stats />
    </div>
  );
}

function Logo() {
  return (
    <div>
      <h1>
        {initialItems.map((pro) => (
          <List items={pro}></List>
        ))}
      </h1>
    </div>
  );
}
function Form() {}
function PackingList() {}
function Stats() {}

function List({ item }) {
  return (
    <div>
      <h2>{item.id}</h2>
    </div>
  );
}

const initialItems = [
  { id: 1, description: "Passports", quantity: 2, packed: false },
  { id: 2, description: "Socks", quantity: 12, packed: false },
];
